    playbackData.comments = {"c1a266ea-375f-4972-95e6-3883e3a66d14":[{"id":"bdb7cce0-87d2-4fd1-8dba-fc684eeb3636","displayCommentEventId":"c1a266ea-375f-4972-95e6-3883e3a66d14","displayCommentEventSequenceNumber":0,"developerGroupId":"dabbfba5-ca5d-4001-b38d-ec634c84d2ba","timestamp":1758065185942,"commentText":"We're going to start from scratch and make a class to represent a bird. Remember this isn't a specific bird, it's a blueprint for as many bird instances as we want to make.","textFormat":"markdown","commentTitle":"Bird Class","ttsFilePath":null,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":["media/audios/1758066171379-browserAudio.mp3"],"linesAbove":0,"linesBelow":0,"currentFilePath":"","viewableBlogText":"","commentTags":["audio"],"questionCommentData":null,"position":0}],"add2cea8-7a31-4a87-8378-2abff033a7e5":[{"id":"e5171d94-2405-49de-9574-7378087a0745","displayCommentEventId":"add2cea8-7a31-4a87-8378-2abff033a7e5","displayCommentEventSequenceNumber":52,"developerGroupId":"1f79586b-f8fd-4633-811f-ee5e72267dd0","timestamp":1758065534875,"commentText":"We're starting with the class header and braces. Remember for this course our classes are always `public`, followed by the word `class` and then the name of the class, in this case `Bird`.\n\n_I usually put both the opening and closing braces in at the same time before I start filling in the class so I don't forget the closing brace later._","textFormat":"markdown","commentTitle":"","ttsFilePath":null,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":["media/audios/1758066444792-browserAudio.mp3"],"linesAbove":0,"linesBelow":0,"currentFilePath":"/Bird.java","viewableBlogText":"","commentTags":["audio"],"questionCommentData":null,"position":0}],"b573bacb-87ce-4ffa-9338-1fa18e7838ab":[{"id":"3910c72f-15e0-4056-a14e-aa11b1427349","displayCommentEventId":"b573bacb-87ce-4ffa-9338-1fa18e7838ab","displayCommentEventSequenceNumber":144,"developerGroupId":"1f79586b-f8fd-4633-811f-ee5e72267dd0","timestamp":1758065633635,"commentText":"First we're going to add two **instance variables**. These are things that can make on Bird instance different from another instance. In our case we're going with just two, the bird's color and the number of wings. \n\nYes, most birds will have two wings. But instance variables aren't necessarily unique between instances, but they might be different.","textFormat":"markdown","commentTitle":"","ttsFilePath":null,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":["media/audios/1758066526081-browserAudio.mp3"],"linesAbove":0,"linesBelow":0,"currentFilePath":"/Bird.java","viewableBlogText":"","commentTags":["audio"],"questionCommentData":null,"position":0}],"19399307-1912-406d-b918-7c40981efe91":[{"id":"cb78446f-add9-44dd-b554-aa4544199956","displayCommentEventId":"19399307-1912-406d-b918-7c40981efe91","displayCommentEventSequenceNumber":270,"developerGroupId":"1f79586b-f8fd-4633-811f-ee5e72267dd0","timestamp":1758065762736,"commentText":"Next, we make our first constructor. This first one is a special kind called either a no argument or default constructor. Notice that it doesn't have any parameters. \n\nAlso notice that a constructor doesn't have a return type. It's special that way. And it's also special that in Java the constructor is always named the same as the class, in this case `Bird`. \n\nThe purpose of a constructor is to get the class ready for use so they typically will set any instance variables.","textFormat":"markdown","commentTitle":"","ttsFilePath":null,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":["media/audios/1758066607171-browserAudio.mp3"],"linesAbove":0,"linesBelow":0,"currentFilePath":"/Bird.java","viewableBlogText":"","commentTags":["audio"],"questionCommentData":null,"position":0}],"21a555f3-6b0a-43ce-9430-19a8f7384050":[{"id":"e55c771c-003b-4d5a-a2ee-f873d2db7b49","displayCommentEventId":"21a555f3-6b0a-43ce-9430-19a8f7384050","displayCommentEventSequenceNumber":472,"developerGroupId":"1f79586b-f8fd-4633-811f-ee5e72267dd0","timestamp":1758065862232,"commentText":"And we added two more constructors. When we have the same method name with different parameter patterns that's called overloading. Only one of these will get called when a new Bird is instantiated.\n\nAnd while we're talking about instantiation, because we have three constructors we can create a new Bird instance in any of the following ways.\n\n```java\nBird a = new Bird();\nBird b = new Bird(\"green\");\nBird c = new Bird(\"purple\", 17);\n```","textFormat":"markdown","commentTitle":"","ttsFilePath":null,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":["media/audios/1758066682989-browserAudio.mp3"],"linesAbove":0,"linesBelow":0,"currentFilePath":"/Bird.java","viewableBlogText":"","commentTags":["audio"],"questionCommentData":null,"position":0}],"02d91dc9-6a99-4c39-a1ce-b3063b8d392a":[{"id":"6d372a54-b53b-451e-adc1-e82b7615a247","displayCommentEventId":"02d91dc9-6a99-4c39-a1ce-b3063b8d392a","displayCommentEventSequenceNumber":647,"developerGroupId":"1f79586b-f8fd-4633-811f-ee5e72267dd0","timestamp":1758066090777,"commentText":"But what happens if we want to get the values out of the instance variables? You probably noticed they're `private` so we can't just read them. \n\nWe do that with accessor methods, sometimes called getter methods. In Java they're typically named by putting \"get\" in front of the instance variable name. And for this course they'll just return a value. \n\nAccessors will always be `public` this year and return the same type as the instance variable.","textFormat":"markdown","commentTitle":"","ttsFilePath":null,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":["media/audios/1758066764354-browserAudio.mp3"],"linesAbove":0,"linesBelow":0,"currentFilePath":"/Bird.java","viewableBlogText":"","commentTags":["audio"],"questionCommentData":null,"position":0}],"b946519e-82ec-4612-8b30-0a6dde4a5a6c":[{"id":"cb40c3c4-9eab-49ad-9704-039b1fee1186","displayCommentEventId":"b946519e-82ec-4612-8b30-0a6dde4a5a6c","displayCommentEventSequenceNumber":824,"developerGroupId":"1f79586b-f8fd-4633-811f-ee5e72267dd0","timestamp":1758066896006,"commentText":"The opposite of a accessor method is a modifier method, sometimes called a mutator or setter. These allow you to change the instance variables from outside.","textFormat":"markdown","commentTitle":"","ttsFilePath":null,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":["media/audios/1758066894367-browserAudio.mp3"],"linesAbove":0,"linesBelow":0,"currentFilePath":"/Bird.java","viewableBlogText":"","commentTags":["audio"],"questionCommentData":null,"position":0}],"0c49837d-2f3d-4b18-87e9-c5d9de9eef7a":[{"id":"2de0ebcc-f8ce-48b6-b644-54d4d6312dec","displayCommentEventId":"0c49837d-2f3d-4b18-87e9-c5d9de9eef7a","displayCommentEventSequenceNumber":1016,"developerGroupId":"1f79586b-f8fd-4633-811f-ee5e72267dd0","timestamp":1758066917674,"commentText":"And then we can add any other methods we want here.","textFormat":"markdown","commentTitle":"","ttsFilePath":null,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":["media/audios/1758067047050-browserAudio.mp3"],"linesAbove":0,"linesBelow":0,"currentFilePath":"/Bird.java","viewableBlogText":"","commentTags":["audio"],"questionCommentData":null,"position":0}]};
